# Path in std::path - Rust

## Struct [std](../index.html)::[path](index.html)::[Path](#)

1.0.0 · [source](about:blank/src/std/path.rs.html#2004-2006) ·

```
pub struct Path { /* private fields */ }
```

Expand description

A slice of a path (akin to [`str`](../primitive.str.html "primitive str")).

This type supports a number of operations for inspecting a path, including breaking the path into its components (separated by `/` on Unix and by either `/` or `\` on Windows), extracting the file name, determining whether the path is absolute, and so on.

This is an _unsized_ type, meaning that it must always be used behind a pointer like `&` or [`Box`](../boxed/struct.Box.html "struct std::boxed::Box"). For an owned version of this type, see [`PathBuf`](struct.PathBuf.html "struct std::path::PathBuf").

More details about the overall approach can be found in the [module documentation](index.html "mod std::path").

## [§](#examples)Examples

```
use std::path::Path;
use std::ffi::OsStr;

// Note: this example does work on Windows
let path = Path::new("./foo/bar.txt");

let parent = path.parent();
assert_eq!(parent, Some(Path::new("./foo")));

let file_stem = path.file_stem();
assert_eq!(file_stem, Some(OsStr::new("bar")));

let extension = path.extension();
assert_eq!(extension, Some(OsStr::new("txt")));
```

