1.0.0 · [source](about:blank/src/std/path.rs.html#2052-2054)

Directly wraps a string slice as a `Path` slice.

This is a cost-free conversion.

##### [§](#examples-1)Examples

```
use std::path::Path;

Path::new("foo.txt");
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::path::Path;%0A++++%0A++++Path::new(%22foo.txt%22);%0A%7D&edition=2021)

You can create `Path`s from `String`s, or even other `Path`s:

```
use std::path::Path;

let string = String::from("foo.txt");
let from_string = Path::new(&string);
let from_path = Path::new(&from_string);
assert_eq!(from_string, from_path);
```

