1.0.0 · [source](about:blank/src/std/path.rs.html#2191-2198)

Returns `true` if the `Path` is absolute, i.e., if it is independent of the current directory.

-   On Unix, a path is absolute if it starts with the root, so `is_absolute` and [`has_root`](about:blank/struct.Path.html#method.has_root "method std::path::Path::has_root") are equivalent.

-   On Windows, a path is absolute if it has a prefix and starts with the root: `c:\windows` is absolute, while `c:temp` and `\temp` are not.


##### [§](#examples-7)Examples

```
use std::path::Path;

assert!(!Path::new("foo.txt").is_absolute());
```

