1.0.0 · [source](about:blank/src/std/path.rs.html#2278-2287)

Returns the `Path` without its final component, if there is one.

This means it returns `Some("")` for relative paths with one component.

Returns [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None") if the path terminates in a root or prefix, or if it’s the empty string.

##### [§](#examples-10)Examples

```
use std::path::Path;

let path = Path::new("/foo/bar");
let parent = path.parent().unwrap();
assert_eq!(parent, Path::new("/foo"));

let grand_parent = parent.parent().unwrap();
assert_eq!(grand_parent, Path::new("/"));
assert_eq!(grand_parent.parent(), None);

let relative_path = Path::new("foo/bar");
let parent = relative_path.parent();
assert_eq!(parent, Some(Path::new("foo")));
let grand_parent = parent.and_then(Path::parent);
assert_eq!(grand_parent, Some(Path::new("")));
let great_grand_parent = grand_parent.and_then(Path::parent);
assert_eq!(great_grand_parent, None);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::path::Path;%0A++++%0A++++let+path+=+Path::new(%22/foo/bar%22);%0A++++let+parent+=+path.parent().unwrap();%0A++++assert_eq!(parent,+Path::new(%22/foo%22));%0A++++%0A++++let+grand_parent+=+parent.parent().unwrap();%0A++++assert_eq!(grand_parent,+Path::new(%22/%22));%0A++++assert_eq!(grand_parent.parent(),+None);%0A++++%0A++++let+relative_path+=+Path::new(%22foo/bar%22);%0A++++let+parent+=+relative_path.parent();%0A++++assert_eq!(parent,+Some(Path::new(%22foo%22)));%0A++++let+grand_parent+=+parent.and_then(Path::parent);%0A++++assert_eq!(grand_parent,+Some(Path::new(%22%22)));%0A++++let+great_grand_parent+=+grand_parent.and_then(Path::parent);%0A++++assert_eq!(great_grand_parent,+None);%0A%7D&edition=2021)

1.28.0 · [source](about:blank/src/std/path.rs.html#2318-2320)

Produces an iterator over `Path` and its ancestors.

The iterator will yield the `Path` that is returned if the [`parent`](about:blank/struct.Path.html#method.parent "method std::path::Path::parent") method is used zero or more times. If the [`parent`](about:blank/struct.Path.html#method.parent "method std::path::Path::parent") method returns [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None"), the iterator will do likewise. The iterator will always yield at least one value, namely `Some(&self)`. Next it will yield `&self.parent()`, `&self.parent().and_then(Path::parent)` and so on.

##### [§](#examples-11)Examples

```
use std::path::Path;

let mut ancestors = Path::new("/foo/bar").ancestors();
assert_eq!(ancestors.next(), Some(Path::new("/foo/bar")));
assert_eq!(ancestors.next(), Some(Path::new("/foo")));
assert_eq!(ancestors.next(), Some(Path::new("/")));
assert_eq!(ancestors.next(), None);

let mut ancestors = Path::new("../foo/bar").ancestors();
assert_eq!(ancestors.next(), Some(Path::new("../foo/bar")));
assert_eq!(ancestors.next(), Some(Path::new("../foo")));
assert_eq!(ancestors.next(), Some(Path::new("..")));
assert_eq!(ancestors.next(), Some(Path::new("")));
assert_eq!(ancestors.next(), None);
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::path::Path;%0A++++%0A++++let+mut+ancestors+=+Path::new(%22/foo/bar%22).ancestors();%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22/foo/bar%22)));%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22/foo%22)));%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22/%22)));%0A++++assert_eq!(ancestors.next(),+None);%0A++++%0A++++let+mut+ancestors+=+Path::new(%22../foo/bar%22).ancestors();%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22../foo/bar%22)));%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22../foo%22)));%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22..%22)));%0A++++assert_eq!(ancestors.next(),+Some(Path::new(%22%22)));%0A++++assert_eq!(ancestors.next(),+None);%0A%7D&edition=2021)

1.0.0 · [source](about:blank/src/std/path.rs.html#2345-2350)

Returns the final component of the `Path`, if there is one.

If the path is a normal file, this is the file name. If it’s the path of a directory, this is the directory name.

Returns [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None") if the path terminates in `..`.

##### [§](#examples-12)Examples

```
use std::path::Path;
use std::ffi::OsStr;

assert_eq!(Some(OsStr::new("bin")), Path::new("/usr/bin/").file_name());
assert_eq!(Some(OsStr::new("foo.txt")), Path::new("tmp/foo.txt").file_name());
assert_eq!(Some(OsStr::new("foo.txt")), Path::new("foo.txt/.").file_name());
assert_eq!(Some(OsStr::new("foo.txt")), Path::new("foo.txt/.//").file_name());
assert_eq!(None, Path::new("foo.txt/..").file_name());
assert_eq!(None, Path::new("/").file_name());
```

