1.7.0 · [source](about:blank/src/std/path.rs.html#2381-2386)

Returns a path that, when joined onto `base`, yields `self`.

##### [§](#errors)Errors

If `base` is not a prefix of `self` (i.e., [`starts_with`](about:blank/struct.Path.html#method.starts_with "method std::path::Path::starts_with") returns `false`), returns [`Err`](about:blank/result/enum.Result.html#variant.Err "variant std::result::Result::Err").

##### [§](#examples-13)Examples

```
use std::path::{Path, PathBuf};

let path = Path::new("/test/haha/foo.txt");

assert_eq!(path.strip_prefix("/"), Ok(Path::new("test/haha/foo.txt")));
assert_eq!(path.strip_prefix("/test"), Ok(Path::new("haha/foo.txt")));
assert_eq!(path.strip_prefix("/test/"), Ok(Path::new("haha/foo.txt")));
assert_eq!(path.strip_prefix("/test/haha/foo.txt"), Ok(Path::new("")));
assert_eq!(path.strip_prefix("/test/haha/foo.txt/"), Ok(Path::new("")));

assert!(path.strip_prefix("test").is_err());
assert!(path.strip_prefix("/haha").is_err());

let prefix = PathBuf::from("/test/");
assert_eq!(path.strip_prefix(prefix), Ok(Path::new("haha/foo.txt")));
```

