1.0.0 · [source](about:blank/src/std/path.rs.html#2482-2484)

Extracts the stem (non-extension) portion of [`self.file_name`](about:blank/struct.Path.html#method.file_name "method std::path::Path::file_name").

The stem is:

-   [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None"), if there is no file name;
-   The entire file name if there is no embedded `.`;
-   The entire file name if the file name begins with `.` and has no other `.`s within;
-   Otherwise, the portion of the file name before the final `.`

##### [§](#examples-16)Examples

```
use std::path::Path;

assert_eq!("foo", Path::new("foo.rs").file_stem().unwrap());
assert_eq!("foo.tar", Path::new("foo.tar.gz").file_stem().unwrap());
```

[Run](https://play.rust-lang.org/?code=%23!%5Ballow(unused)%5D%0Afn+main()+%7B%0A++++use+std::path::Path;%0A++++%0A++++assert_eq!(%22foo%22,+Path::new(%22foo.rs%22).file_stem().unwrap());%0A++++assert_eq!(%22foo.tar%22,+Path::new(%22foo.tar.gz%22).file_stem().unwrap());%0A%7D&edition=2021)

##### [§](#see-also)See Also

This method is similar to [`Path::file_prefix`](about:blank/struct.Path.html#method.file_prefix "method std::path::Path::file_prefix"), which extracts the portion of the file name before the _first_ `.`

[source](about:blank/src/std/path.rs.html#2516-2518)

🔬This is a nightly-only experimental API. (`path_file_prefix` [#86319](https://github.com/rust-lang/rust/issues/86319))

Extracts the prefix of [`self.file_name`](about:blank/struct.Path.html#method.file_name "method std::path::Path::file_name").

The prefix is:

-   [`None`](about:blank/option/enum.Option.html#variant.None "variant std::option::Option::None"), if there is no file name;
-   The entire file name if there is no embedded `.`;
-   The portion of the file name before the first non-beginning `.`;
-   The entire file name if the file name begins with `.` and has no other `.`s within;
-   The portion of the file name before the second `.` if the file name begins with `.`

##### [§](#examples-17)Examples

```
use std::path::Path;

assert_eq!("foo", Path::new("foo.rs").file_prefix().unwrap());
