1.0.0 · [source](about:blank/src/std/path.rs.html#2679-2689)

Produces an iterator over the [`Component`](enum.Component.html "enum std::path::Component")s of the path.

When parsing the path, there is a small amount of normalization:

-   Repeated separators are ignored, so `a/b` and `a//b` both have `a` and `b` as components.

-   Occurrences of `.` are normalized away, except if they are at the beginning of the path. For example, `a/./b`, `a/b/`, `a/b/.` and `a/b` all have `a` and `b` as components, but `./a/b` starts with an additional [`CurDir`](about:blank/enum.Component.html#variant.CurDir "variant std::path::Component::CurDir") component.

-   A trailing slash is normalized away, `/a/b` and `/a/b/` are equivalent.


Note that no other normalization takes place; in particular, `a/c` and `a/b/../c` are distinct, to account for the possibility that `b` is a symbolic link (so its parent isn’t `a`).

##### [§](#examples-22)Examples

```
use std::path::{Path, Component};
use std::ffi::OsStr;

let mut components = Path::new("/tmp/foo.txt").components();

assert_eq!(components.next(), Some(Component::RootDir));
assert_eq!(components.next(), Some(Component::Normal(OsStr::new("tmp"))));
assert_eq!(components.next(), Some(Component::Normal(OsStr::new("foo.txt"))));
assert_eq!(components.next(), None)
```

