1.63.0 · [source](about:blank/src/std/path.rs.html#2902-2904)

Returns `Ok(true)` if the path points at an existing entity.

This function will traverse symbolic links to query information about the destination file. In case of broken symbolic links this will return `Ok(false)`.

[`Path::exists()`](about:blank/struct.Path.html#method.exists "method std::path::Path::exists") only checks whether or not a path was both found and readable. By contrast, `try_exists` will return `Ok(true)` or `Ok(false)`, respectively, if the path was _verified_ to exist or not exist. If its existence can neither be confirmed nor denied, it will propagate an `Err(_)` instead. This can be the case if e.g. listing permission is denied on one of the parent directories.

Note that while this avoids some pitfalls of the `exists()` method, it still can not prevent time-of-check to time-of-use (TOCTOU) bugs. You should only use it in scenarios where those bugs are not an issue.

##### [§](#examples-31)Examples

```
use std::path::Path;
assert!(!Path::new("does_not_exist.txt").try_exists().expect("Can't check existence of file does_not_exist.txt"));
assert!(Path::new("/root/secret_file.txt").try_exists().is_err());
```

